import Vue from 'vue';
import Router from 'vue-router';
Vue.use(Router);
export default new Router({
  routes: [{
    path: '/',
    redirect: '/dashboard'
  }, {
    path: '/',
    component: function component(resolve) {
      return require(['../components/common/Home.vue'], resolve);
    },
    meta: {
      title: 'self_config'
    },
    children: [{
      path: '/dashboard',
      component: function component(resolve) {
        return require(['../components/page/Dashboard.vue'], resolve);
      },
      meta: {
        title: 'Home'
      }
    }, {
      path: '/history',
      component: function component(resolve) {
        return require(['../components/page/HistoryTable.vue'], resolve);
      },
      meta: {
        title: 'Recode'
      }
    }, {
      path: '/data',
      name: 'data',
      component: function component(resolve) {
        return require(['../components/page/DataTable.vue'], resolve);
      },
      meta: {
        title: 'Table'
      }
    }, {
      path: '/suite',
      name: 'suite',
      component: function component(resolve) {
        return require(['../components/page/SuiteTable.vue'], resolve);
      },
      meta: {
        title: 'Suite'
      }
    }, {
      path: '/404',
      component: function component(resolve) {
        return require(['../components/page/404.vue'], resolve);
      },
      meta: {
        title: '404'
      }
    }, {
      path: '/403',
      component: function component(resolve) {
        return require(['../components/page/403.vue'], resolve);
      },
      meta: {
        title: '403'
      }
    }]
  }, {
    path: '/login',
    component: function component(resolve) {
      return require(['../components/page/Login.vue'], resolve);
    }
  }, {
    path: '*',
    redirect: '/404'
  }]
});
